import { List, Typography } from "@mui/material";
import { useSelector } from "react-redux";
import styled from "styled-components";
import { StyledUl, ListChild } from "./UndoneTodoList";
import { MakeListChild } from "./UndoneTodoList";

const DoneTodoList = () => {
  const doneTodoList = useSelector((state) => state.doneTodoList.list);

  return (
    <div>
      <Typography variant="h6">DoneTodoList</Typography>
      <StyledUl>
        {doneTodoList.map((it) => {
          return MakeListChild("red", <li>{it.content}</li>);
        })}
      </StyledUl>
    </div>
  );
};

export default DoneTodoList;
